import React from 'react';
import './Session.css';

class Session extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="Session">
                <FontAwesomeIcon icon={faPlay} className="icon" />
                <FontAwesomeIcon icon={faTrash} className="icon danger" /> 
                {this.props.title}
            </div>
        );
    }
}
